import React from "react";
import ReactDom from "react-dom";
import "./style.css"
import insta from './insta_logo.png';
import whatsapp from './whatsapp.png'
import fb from './fb_logo.jpeg'
import twitter from './twitter.png';
import cat from './cat.jpeg';



const Info = () =>
{
    return (
      <>
        <img src = {cat} />
        <h2>Carlos Monti</h2>
        <p>Frontend Developer</p>
        <p>Laura Smith.Website</p>
        <button>Email</button>
        <button>LinkedIn</button>
      </>
    )
}

const About = () =>
{
  return (
    <>
      <h3>About</h3>
      <p>
        Mount Everest is the tallest mountain in the world.<br></br>
        Pacific ocean is the largest ocean in the world.<br></br>
        Asia is the biggest continent.<br></br>
        There is a Lake Within an Island on a Lake Within an Island.<br></br>
      </p>
      <h3>Interests</h3>
      <p>
        Mount Everest is the tallest mountain in the world.<br></br>
        Pacific ocean is the largest ocean in the world.<br></br>
        Asia is the biggest continent.<br></br>
        There is a Lake Within an Island on a Lake Within an Island.<br></br>
      </p>
    </>
  )
}

const Footer = () =>
{
  return (
    <>
      <img src  = {insta}/>
      <img src  = {whatsapp}/>
      <img src  = {fb}/>
      <img src  = {twitter}/>
    </>


  )
}


const Element = <div className="container">
  <Info/>
  <About/>
  <Footer/>
</div>

const root = ReactDom.createRoot(document.getElementById('root'));
root.render(Element);
